import "./App.css";
import "./Styles/Login.css";
import {
  createBrowserRouter,
  RouterProvider,
  Route,
  Router,
  Routes,
  Outlet,
  Navigate,
} from "react-router-dom";
import Login from "./Pages/Login";
import NavBar from "./Pages/NavBar";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/login" exact element={<Login />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
